import './App.css';
import { Content, Row, Col } from './modules/Grid'

function App() {
  return (
    <div className="App">
      <Content container='container'>
        <Row>
          <Col col='col-md-4'>
            <div className='bg-primary'> 1 of 3</div>
          </Col>
          <Col col='col-md-4'>
            <div className='bg-primary'> 2 of 3</div>
          </Col>
          <Col col='col-md-4'>
            <div className='bg-primary'> 3 of 3</div>
          </Col>
        </Row>
      </Content>
    </div>
  );
}

export default App;
